import React from 'react'

function Home() {
  return (
    <div id="home" className="flex j-center a-center full flex-column gap">
      <h1 className="light">Welcome Admin</h1>
      <p className="text-clr text-center mb-10">
        Welcome to the administrative home page of our e-commerce platform, <br /> where you can efficiently manage products, orders, and customer interactions with ease.
      </p>
    </div>
  )
}

export default Home
